import './Portfolio.css';
import './data.js';


function Portfolio(){
    return (
       <section className="portfolio mtop">
        <div className="container">
            <div className="head flexSB">
                <div className="left">
                    <h6>Creative works</h6>
                    <h2>Checkout my Portfolio</h2>
                </div>
            </div>
            <div className="links">
                div.flex
            </div>
        </div>
       </section>
    )
}
export default Portfolio;
